    private static JSONObject deepMergeOne(JSONObject srcObj, JSONObject addObj) throws JSONException {

        Iterator<String> itKeys1 = addObj.keys();
        String key, value;
        while (itKeys1.hasNext()) {
            key = itKeys1.next();
            value = addObj.optString(key);
            srcObj.put(key, value);
        }
        return srcObj;
    }


    public static JSONObject deepMergeTwo(JSONObject source, JSONObject target) throws JSONException {
        for (Object key : source.keySet()) {
            Object value = source.get(key);
            if (!target.containsKey(key)) {
                // new value for "key":
                target.put(key, value);
            } else {
                // existing value for "key" - recursively deep merge:
                if (value instanceof JSONObject) {
                    JSONObject valueJson = (JSONObject) value;
                    deepMergeTwo(valueJson, target.getJSONObject(key.toString()));
                } else {
                    target.put(key, value);
                }
            }
        }
        return target;
    }
